import React, { Component } from 'react';
import './trailer.css';

class trailer extends Component{

    render(){
        return(
            <section className="trailer-wrapper">
                <video loop autoplay>
                <source src="./dummy.mov" type="video/mov"></source>
                </video>
            </section>
        );
    }

}

export default trailer;
